import React, { Component } from 'react';
import { useState } from 'react';
import {useNavigate} from 'react-router-dom';
import '../editprofile.css';

class EditProfile extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      userName: '',
      password: '',
      height:'',
      age: '',
      gender: '',
      weight: '',
      exerciseFlag: '',
    };
}
}
function EditProfilePage() {

  const [message, setMessage] = useState('');
  const [updated, setUpdated] = useState(message);

  const handleChange = event => {
    setMessage(event.target.value);
    console.log('userName is: ', event.target.value);
  };

  const handleClick = () => {
    setUpdated(message);
  };

  const navigate = useNavigate();

  const navigateToDashboard = () => {
  navigate('/dashboard');
  };

  function update() {
    handleClick();
    navigateToDashboard();
  }

  return (
    <html>
      <head>
        <title>
          Profile Page
        </title>
      </head>

      <body>
        <div className="App-header">
          <header>
            <p>
              Edit Profile
            </p>
          </header>
        </div>
        <div className='App-body'>
          <form>
            <div>              
              <div>Username</div>              
              <input type="text" id="userName" name="userName" onChange={handleChange} value={message} placeholder="username"/>  
            </div>
            <div>
              <div>Password</div>                              
              <input type="password" id="password" name="password" onChange={handleChange} value={message} placeholder="password"/>  
            </div>
            <div>
              <div>Account Number</div>                            
              <input type="text" placeholder="ID"/>  
            </div>
            <div>
              <div>Height</div>                              
              <input type="text" placeholder="meters"/>  
            </div>
            <div>
              <div>Age</div>
              <input type="text" placeholder="years"/>  
            </div>
            <div>
              <div>Gender</div>
              <input type="text" placeholder="gender"/>  
            </div>
            <div>
              <div>Weight</div>
              <input type="text" placeholder="pounds"/>  
            </div>
            <div>
              <div>Notepad ID</div>                              
              <input type="text" placeholder="ID"/>  
            </div>
            <div>
              <div>Food objects list</div>                              
              <input type="text" placeholder="list"/>  
            </div>
            <div>
              <div>Exercise flag</div>            
              <input type="text" placeholder="integer"/>  
            </div>
            <div className='submit'>
              <input onClick={update} type="submit" value="Submit"/>
            </div>
          </form>
        </div>
      </body>
    </html>          
  );
}

export default EditProfilePage;
